css:
.nuclide-refactorizer-header {
  display: flex;
  align-items: baseline;
  justify-content: space-between;
  margin-bottom: 10px;
}
.nuclide-refactorizer-selectable {
  cursor: pointer;
}
.nuclide-refactorizer-selectable-text {
  color: #121417;
}
.nuclide-refactorizer-selected-text {
  color: #000000;
}
.nuclide-refactorizer-selected {
  background-color: #5a8ae9;
}
.nuclide-refactorizer-unselectable-text {
  color: #6f7a90;
  opacity: 0.5;
}
.nuclide-refactorizer-button {
  margin-right: 10px;
}
.nuclide-refactorizer-freeform-group {
  margin-bottom: 10px;
}
.nuclide-refactorizer-freeform-label {
  margin-bottom: 5px;
}
.nuclide-refactorizer-confirm-list {
  margin-top: 10px;
  max-height: 500px;
  overflow: auto;
}
.nuclide-refactorizer-confirm-list-item {
  max-width: 100%;
  overflow: hidden;
  text-overflow: ellipsis;
  vertical-align: top;
}
.nuclide-refactorizer-confirm-list-path {
  color: #000000;
}
.nuclide-refactorizer-diff-preview-icon {
  display: inline-block;
  color: #1492ff;
}
.nuclide-refactorizer-diff-preview-icon:hover {
  cursor: pointer;
  color: #121417;
}
.nuclide-refactorizer-progress {
  margin-top: 10px;
}
.nuclide-refactorizer-progress progress {
  width: 100%;
}
